import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the search input to be visible and type a product name
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    await page.fill('#searchInput', 'iPhone');

    // Click the search button
    await page.click('.search-btn');

    // Wait for the wishlist link to be visible
    await page.waitForSelector('a:has-text("Your Wish List")', { timeout: 5000 });

    // Click on the wishlist link
    await page.click('a:has-text("Your Wish List")');

    // Wait for the product to be added to the wishlist
    await page.waitForSelector('.wishlist-items', { timeout: 5000 });

    // Take a screenshot of the wishlist
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_wishlist.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_wishlist.png'));

    return {
      success: true,
      action: "Product added to wishlist and wishlist displayed",
      extractedData: {},
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
